import React from "react";
import { createUseStyles } from "react-jss";
import * as variables from "../variables";
import background from "../media/background.png";
import mobile from "../media/mobile.png";
import logo from "../media/logo.png";
import ios from "../media/ios.png";
import android from "../media/android.png";

const useStyles = createUseStyles({
  header: {
    display: "flex",
    flexDirection: "row",
  },
  download: {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    '& > img': {
        max
    },
  },
  background: {
    position: "absolute",
    top: "-310px",
    left: 0,
    width: "1920px",
    height: "auto",
  },
  mobile: {
    maxHeight: "500px",
  },
});

export default function Header() {
  const classes = useStyles();
  return (
    <div className={classes.header}>
      <div className={classes.download}>
        <img src={ios} alt="ios" className={classes.btnDownload} />
        <p>ou</p>
        <img src={android} alt="android" className={classes.btnDownload} />
      </div>
      <img src={mobile} alt="phone" className={classes.mobile} />
      <div className={classes.presentation}>
        <img src={logo} alt="logo" className={classes.logo} />
      </div>
      <img src={background} alt="background" className={classes.background} />
    </div>
  );
}
